import React from "react";

export default function Contact() {
  return (
    <div className="contact__wrap">
    <h1>React    hooks Contact Form</h1>
    <form 
      onSubmit={e=>sendMessage(e)} 
      className="contact__form">
        <input 
          value={inputs.name} 
          onChange={e=>handleInputChange(e)} 
          type="text" name="name" 
          placeholder="name" 
          title="Your name" 
          maxLength="50" 
          required/>
        <input 
          value={inputs.email} 
          onChange={e=>handleInputChange(e)} 
          type="email" name="email" 
          placeholder="email" 
          title="Your email" 
          maxLength="50" 
          required/>
        <textarea 
          value={inputs.message} 
          onChange={e=>handleInputChange(e)} 
          type="text" name="message" 
          placeholder="message" 
          title="Your message" 
          maxLength="550" 
          required/>
        <input 
          type="submit" 
          value="send message"/>
    </form> 
  </div>
  );
}
